script: |
  super -f text -I q6190.spq | sort > q6190.out

inputs:
  - name: q6190.spq
    data: |
      SELECT ALL col2 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + col2 * - col2 + - col1 + + - col2 + + col2 * 65 NOT IN ( + 41 + ( + col2 ), - col1, + col0 );
  - name: tab2

outputs:
  - name: q6190.out
    data: |
